import React, { Component } from "react";
import { Link } from 'react-router-dom';
import './header.css'
class NavbarPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      target: "home" //home by default
    };
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick(e) {
    this.setState({
      target: e.target.value
    });
  }

  render() {
    return (
      <div>
        <nav>
          <ul>
            <li>
              <Link to='/' onClick={this.handleClick} value="home">
                Home
              </Link>
            </li>
            <li>
              <Link to='/About' onClick={this.handleClick} value="about">
                About
              </Link>
            </li>
            <li>
              <Link to='/Skills' onClick={this.handleClick} value="contact">
                Skills
              </Link>
            </li>
          </ul>
        </nav>

      </div>
    );
  }
}

export default NavbarPage;
